import {Link, Redirect, Route, Switch, useLocation } from "react-router-dom";
import { Layout, Menu, Typography } from 'antd';
import * as Navigation from './navigatoin';
import './App.css';



const App = () => {
  const location = useLocation();
  const title = "Inconspicuous Encryption";

  return (
    <>
        <Layout className="App" style={{ height: "100%" }}>
          <Layout.Sider style={{ background:"#11274c" }}>
            <Typography.Title
              level={4}
              style={{
                  margin: 25,
                  color:"white",
                  background:"#11274c",
                  fontSize:"x-large",
                  minWidth:75
                }}
              >
              {title}
            </Typography.Title>
            <Menu
              mode="inline"
              selectedKeys={selectedMenuKeys(location.pathname)}
              style={{
                background:"#11274c",
                color:"white",
                minHeight: "100vh",
                marginBlockStart:"1.33em",
                marginBlockEnd:"1.33em",
                marginInlineStart: "0px",
                marginInlineEnd:"0px",
                display:"block"

              }}
            >
              <Menu.Item
                key={Navigation.HOME}
              >
                <Link 
                  to={Navigation.HOME}
                  style={{color:"white"}}
                >
                  Home
                </Link>
              </Menu.Item>
              <Menu.Item
                key={Navigation.ENCRYPT}
              >
                <Link
                  to={Navigation.ENCRYPT}
                  style={{color:"white"}}
                >
                  Encrypt
                </Link>
              </Menu.Item>
              <Menu.Item
                key={Navigation.DECRYPT}
                style={{}}
              >
                <Link 
                  to={Navigation.DECRYPT}
                  style={{color:"white"}}
                >
                  Decrypt
                </Link>
              </Menu.Item>

            </Menu>
          </Layout.Sider>
        </Layout>
    </>
  );
}

